import React, { useState } from 'react';
import { Link, NavLink } from 'react-router-dom';
import '../style/navbar.css';
import logo from '../external/logo.png';

function NavBar() {
    const [clicked, setClicked] = useState(false);

    handleOnClick = () => {
        setClicked(true);
    }
    return (
        <React.Fragment>
            <nav id="navbar">
                <Link to='/'><img src={logo} /></Link>
                <div id="menu-container">
                    <ul id="menu-lists">
                        <li id="menu-list"><NavLink href='/' id="menu-item" to='/'>Home</NavLink></li>
                        <li id="menu-list"><NavLink href='/' id="menu-item" to='/blog'>Blog</NavLink></li>
                        <li id="menu-list"><NavLink href='/' id="menu-item" to='/sign-up'>SignUp</NavLink></li>
                        <li id="menu-list"><NavLink href='/' id="menu-item" to='/sign-in'>SignIn</NavLink></li>
                    </ul>
                </div>
                <div id="mobile">
                    <i className={!clicked ? 'fas fa-bars' : 'fas fa-times'}></i>
                </div>
            </nav>
        </React.Fragment>
    );
}

export default NavBar;
